"""
Given an input string, reverse the string word by word.

For example,
Given s = "the sky is blue",
return "blue is sky the".

"""


class Solution(object):
    # def reverseWords_tmp(self, s):
    # def reverseWords_PRACTICE(self, s):
    def reverseWords(self, s):
        return

    def reverseWords_PASSED(self, s):
    # def reverseWords(self, s):
        s = s.split(" ")
        s = s[::-1]
        s = [x for x in s if x != ""]
        return " ".join(s)

    def reverseWords_TIMEOUT(self, s):
    # def reverseWords(self, s):
        """
        :type s: str
        :rtype: str
        """
        s = list(s.strip(" "))
        _len = len(s)
        mark = 0
        i = 0

        while i < _len:
            count = 0
            while s[-1] != " " and i != _len:
                s.insert(mark, s.pop())
                count += 1
                i += 1
            if i != 0:
                if s[-1] == " ":
                    s.insert(i, s.pop())
                    i += 1
                while s[-1] == " ":
                    s.pop()
                    _len -= 1
            mark = i
        return ''.join(s)

def main():
    # blue is sky the
    print(Solution().reverseWords("the sky is  blue"))
    print(Solution().reverseWords(" "))     # ""
    print(Solution().reverseWords("       "))     # ""
    print(Solution().reverseWords("a"))     # "a"
    print(Solution().reverseWords("l "))     # "l"
    print(Solution().reverseWords("            "))     # ""
    print(Solution().reverseWords("   a   b "))  # "a b"
    print(Solution().reverseWords("   a   b  c d   e  "))  # "e d c b a"

